pragma solidity ^0.7.1;
pragma experimental ABIEncoderV2;

import '@balancer-labs/v2-solidity-utils/contracts/openzeppelin/IERC20.sol';
import '@balancer-labs/v2-solidity-utils/contracts/openzeppelin/ERC20.sol';
import '@balancer-labs/v2-solidity-utils/contracts/openzeppelin/Ownable.sol';

import '@balancer-labs/v2-vault/contracts/interfaces/IVault.sol';
import '@balancer-labs/v2-vault/contracts/interfaces/IAsset.sol';

import './interfaces/IPrimaryIssuePoolFactory.sol';
import './interfaces/IPrimaryIssuePool.sol';
import './interfaces/VerifiedIssues.sol';
import './interfaces/VerifiedProducts.sol';
import './interfaces/IMarketMaker.sol';

contract BalancerManager is IMarketMaker, Ownable{

    // balancer variables
    IPrimaryIssuePoolFactory public factory;
    IVault vault;
    uint256 swapFeePercentage=0;
    
    // a token contributed to the primary issue pool has an 'owner' which could be the issuer or market maker
    // the token contributor offers the 'amountOffered' of the token, the token could be the security issued or the its paired token
    // the token contributor specifies the 'amountDesired' of another token (liquidity token) that is paired to the token offered 
    // if the token contributor is an issuer, it specifies the 'min' size of an investor's or market maker's bid for liquidity tokens offered
    // if the token contributor is a market maker, it specifies the 'min' size of an issuer's offer for tokens bid 
    struct token{
        address owner;
        uint amountOffered;
        uint amountDesired;
        uint min;
        bytes32 isin;
    }

    // array of offers of security tokens and liquidity tokens to pair them with
    address[] internal offeredTokens;

    // mapping offered token to liquidity token
    mapping(address => mapping(address => token)) internal mmtokens;

    struct liquidity{
        uint minPrice;
        uint maxPrice;
        uint amountIssued;
        uint amountOffered;
    }

    // array of liquidity tokens  
    address[] internal pairedTokens;

    // mapping qualified liquidity token to its price and amount offered by market makers (LPs)
    mapping(address => mapping(address => liquidity)) internal qltokens;

    // components of a primary issue of a security token
    struct primary{
        uint256 deadline;
        uint256 startTime;
        bytes32[] pools;
        address issuer;
    }

    //mapping security to new issues
    mapping(address => primary) internal issues;

    //mapping new issue to collateral
    //mapping(bytes32 => address) internal collateral;

    //investments are drawn down to broker's custody accounts for liquidation
    struct account{
        address custodyAccount;
        bytes32 tokenName;
    }

    mapping(bytes32 => account[]) internal brokerages;

    bytes32[] internal brokers;
    
    // mapping pool to subscribers that swap in assets into pool
    mapping(bytes32 => IMarketMaker.subscriptions[]) internal investors; 

    VerifiedProducts products;

    function initialize(address _factory, uint256 _swapFeePercentage, address _vault, address _products) public {
        require(msg.sender == owner());
        factory = IPrimaryIssuePoolFactory(_factory);
        vault = IVault(_vault);
        swapFeePercentage = _swapFeePercentage;
        products = VerifiedProducts(_products);
        products.registerPlatform(address(this), owner());
    }

    function addBroker(bytes32 name, address custody, bytes32 broker) override external {
        require(msg.sender == owner());
        bool found = false;
        uint i;
        for(i=0; i<brokerages[broker].length; i++){
            if(brokerages[broker][i].tokenName==name){
                brokerages[broker][i].custodyAccount = custody;
                found = true;
            }
        }
        if(!found){
            brokerages[broker][i+1].tokenName = name;
            brokerages[broker][i+1].custodyAccount = custody;
            brokers.push(broker);
        }
    }

    // sets this asset manager as the relayer for the sender who which provides liquidity
    function setRelayer() override external {
        require(products.checkIssue(msg.sender)==true);
        vault.setRelayerApproval(msg.sender, address(this), true);
    }

    // called by market maker and issuer for adding liquidity
    // 'owned' is the security or token on offer, 'offered' is the amount offered
    // 'tomatch' is the token that is required to be paired, 'desired' is the amount required of the token to be paired
    // 'min' is the minimum amount to be swapped of the 'offered' token if this function is called by issuer
    // 'min' is the minimum fee to be charged for a swap if this function is called by a market maker
    function make(address owned, bytes32 isin, uint offered, address tomatch, uint desired, uint min) override external {
        require(IERC20(owned).balanceOf(msg.sender)>=offered, 'Offered amount is not in balance'); 
        IERC20(owned).transferFrom(msg.sender, address(this), offered);
        mmtokens[owned][tomatch].owner = msg.sender;
        mmtokens[owned][tomatch].amountDesired = desired;
        mmtokens[owned][tomatch].amountOffered = offered;
        mmtokens[owned][tomatch].min = min;
        mmtokens[owned][tomatch].isin = isin;
        offeredTokens.push(owned);
    }

    //called by issuer of 'security' token to open an issue which will last till 'cutoffTime'
    function issue(address security, uint256 cutoffTime) override external {
        require(products.checkIssue(msg.sender)==true);
        for(uint i=0; i<offeredTokens.length; i++){
            // check if security to be issued has been offered by the issuer, and if yes, initialize the issuance
            if(offeredTokens[i]==security){
                IERC20[] memory tokens = new IERC20[](2);
                tokens[0] = IERC20(offeredTokens[i]);
                uint256[] memory prices = new uint256[](2);
                
                // check all offered securities that is not the security to be issued
                for(uint j=0; j<offeredTokens.length; j++){
                    if(offeredTokens[j]!=security){

                        // check if the request to issue has come from the issuer
                        if(mmtokens[offeredTokens[i]][offeredTokens[j]].owner == msg.sender){

                            // find tokens offered against security to be issued
                            if(mmtokens[offeredTokens[i]][offeredTokens[j]].amountOffered!=0){
                                if(mmtokens[offeredTokens[j]][offeredTokens[i]].amountOffered!=0){
                                    
                                    // if min offer price for security issued is greater than price desired by market maker (LP)
                                    if(mmtokens[offeredTokens[i]][offeredTokens[j]].min / 
                                        mmtokens[offeredTokens[i]][offeredTokens[j]].amountOffered >
                                        mmtokens[offeredTokens[j]][offeredTokens[i]].amountOffered / 
                                        mmtokens[offeredTokens[j]][offeredTokens[i]].amountDesired)
                                    {   
                                        // store liquidity tokens    
                                        bool found = false;
                                        for(uint k=0; k<pairedTokens.length; k++){
                                            if(pairedTokens[k]==offeredTokens[j])
                                                found = true;
                                        }
                                        if(!found)
                                            pairedTokens.push(offeredTokens[j]);

                                        // find and store min price for token offered
                                        if(mmtokens[offeredTokens[i]][offeredTokens[j]].min/
                                            mmtokens[offeredTokens[i]][offeredTokens[j]].amountOffered < 
                                            qltokens[security][offeredTokens[j]].minPrice  || qltokens[security][offeredTokens[j]].minPrice==0)
                                        {
                                            qltokens[security][offeredTokens[j]].minPrice = 
                                                        mmtokens[offeredTokens[i]][offeredTokens[j]].min/
                                                        mmtokens[offeredTokens[i]][offeredTokens[j]].amountOffered;
                                        }
                                        // find and store max price for token offered
                                        if(mmtokens[offeredTokens[j]][offeredTokens[i]].amountOffered / 
                                            mmtokens[offeredTokens[j]][offeredTokens[i]].min > qltokens[security][offeredTokens[j]].maxPrice)
                                        {
                                            qltokens[security][offeredTokens[j]].maxPrice = 
                                                        mmtokens[offeredTokens[j]][offeredTokens[i]].amountOffered/
                                                        mmtokens[offeredTokens[j]][offeredTokens[i]].min;                                        
                                        }  
                                        qltokens[security][offeredTokens[j]].amountIssued = 
                                                        qltokens[security][offeredTokens[j]].amountIssued + 
                                                        mmtokens[offeredTokens[i]][offeredTokens[j]].amountOffered;
                                        qltokens[security][offeredTokens[j]].amountOffered = 
                                                        qltokens[security][offeredTokens[j]].amountOffered + 
                                                        mmtokens[offeredTokens[j]][offeredTokens[i]].amountOffered;    
                                    }
                                }
                            }
                        }
                    }
                }
                //create primary issue pool if it does not exist already
                for(uint x=0; x<pairedTokens.length; x++){
                    address lptoken = pairedTokens[x];
                    tokens[1] = IERC20(lptoken);
                    prices[0] = qltokens[security][lptoken].minPrice;
                    prices[1] = qltokens[security][lptoken].maxPrice;
                    address newIssue = factory.create(
                        ERC20(security).symbol(),
                        ERC20(lptoken).symbol(),
                        tokens,
                        prices,
                        swapFeePercentage,
                        cutoffTime,
                        address(this)
                    );
                    // store details of new pool created
                    issues[security].issuer = mmtokens[security][lptoken].owner;
                    issues[security].deadline = cutoffTime;
                    issues[security].startTime = block.timestamp;
                    bytes32 pool = IPrimaryIssuePool(newIssue).getPoolId();
                    issues[security].pools[issues[security].pools.length] = pool;
                    //collateral[pool] = lptoken;
                    // join the pool
                    IAsset[] memory _assets = new IAsset[](2);
                    _assets[0] = IAsset(security);
                    _assets[1] = IAsset(lptoken);
                    uint256[] memory _maxAmountsIn = new uint256[](2);
                    _maxAmountsIn[0] = qltokens[security][lptoken].amountIssued;
                    _maxAmountsIn[1] = qltokens[security][lptoken].amountOffered;
                    IVault.JoinPoolRequest memory request = IVault.JoinPoolRequest({
                        assets: _assets,
                        maxAmountsIn: _maxAmountsIn,
                        userData: abi.encodePacked(security),
                        fromInternalBalance: false
                    });                                        
                    vault.joinPool(pool, address(this), address(this), request);
                }
            }
        }
    }

    // called by pool when assets are swapped in by investors against security tokens issued
    function subscribe(bytes32 poolId, address security, address assetIn, bytes32 assetName, uint256 amount, address investor, uint256 price) override external {
        require(poolId == IPrimaryIssuePool(security).getPoolId());
        investors[poolId].push(IMarketMaker.subscriptions(investor, assetIn, assetName, amount, price));
    }

    function getSubscribers(bytes32 poolId) override external view returns(subscriptions[] memory){
        return investors[poolId];
    }

    // called by issuer to close subscription of 'security' issued by it 
    function close(address security) override external view returns(bytes32[] memory) {
        if(block.timestamp > issues[security].deadline)
            return issues[security].pools;
    }

    // called by issuer to accept subscription to issue by investor
    function accept(bytes32 poolid, address investor, uint256 amnt, address asset) override external {
        require(products.checkIssue(msg.sender)==true);
        (address pool, ) = vault.getPool(poolid);
        uint256 invested = 0;
        for(uint i=0; i<investors[poolid].length; i++){
            if(investors[poolid][i].investor == investor)
                invested = invested + investors[poolid][i].amount;
        }
        // transfer subscriptions for allotments to brokerage for asset subscribed with
        for(uint x=0; x<brokers.length; x++){
            for(uint i=0; i<brokerages[brokers[x]].length; i++){
                if(keccak256(abi.encodePacked(brokerages[brokers[x]][i].tokenName))==keccak256(abi.encodePacked(ERC20(asset).name()))){
                    IVault.PoolBalanceOp[] memory ops = new IVault.PoolBalanceOp[](1);
                    ops[0] = IVault.PoolBalanceOp({
                        kind: IVault.PoolBalanceOpKind.WITHDRAW,
                        poolId: poolid,
                        token: IERC20(asset),
                        amount: invested
                    });
                    vault.managePoolBalance(ops);
                    // transfer allotted amount to brokerage
                    IERC20(asset).transfer(brokerages[brokers[x]][i].custodyAccount, amnt);
                    // refund balance to investors
                    IERC20(asset).transfer(investor, invested - amnt);
                }
            }
        }
    }

    // called by issuer to reject subscription to issue by investor
    function reject(bytes32 poolid, address investor) override external {
        require(products.checkIssue(msg.sender)==true);
        (address pool, ) = vault.getPool(poolid);
        for(uint i=0; i<investors[poolid].length; i++){
            if(investors[poolid][i].investor == investor){
                IVault.PoolBalanceOp[] memory ops = new IVault.PoolBalanceOp[](1);
                ops[0] = IVault.PoolBalanceOp({
                    kind: IVault.PoolBalanceOpKind.WITHDRAW,
                    poolId: poolid,
                    token: IERC20(investors[poolid][i].asset),
                    amount: investors[poolid][i].amount
                });
                vault.managePoolBalance(ops);
                IERC20(investors[poolid][i].asset).transfer(investor, investors[poolid][i].amount);
            }
        }
    }

    // withdraws liquidity token shares in pool if the issue is not subscribed fully
    function withdraw(address security, uint amount) override external {
               
    }

    // settles liquidity token shares in pool in favour of market makers for amounts not used in subscription 
    function settle(bytes32 poolId) override external {
        
    }   
    
}
